import React, { Component } from 'react';
import './App.css';

import Welcome from './components/Welcome/Welcome'

class App extends Component {
  componentDidMount() {
  }

  render() {
    return (
      <div className="App">
        <Welcome />
      </div>
    );
  }
}

export default App;
